import React from 'react';

const NavigationComponent = () => {
  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div>
      <ul>
        <li onClick={() => scrollToSection('section1')}>Section 1</li>
        <li onClick={() => scrollToSection('section2')}>Section 2</li>
        <li onClick={() => scrollToSection('section3')}>Section 3</li>
      </ul>

      <div id="section1" style={{ height: '100vh', backgroundColor: 'lightblue' }}>
        Section 1
      </div>
      <div id="section2" style={{ height: '100vh', backgroundColor: 'lightgreen' }}>
        Section 2
      </div>
      <div id="section3" style={{ height: '100vh', backgroundColor: 'lightcoral' }}>
        Section 3
      </div>
    </div>
  );
};

export default NavigationComponent;
